import React from 'react';

function Calendar() {
  return (
    <div className="bg-[#16181a] text-gray-200 h-full overflow-auto p-6">
      {/* Simple calendar grid */}
      <div className="bg-[#1c1e22] rounded-xl shadow-lg overflow-hidden">
        <div className="grid grid-cols-7 border border-[#2a2d32] divide-x divide-[#2a2d32]">
          {/* Day Headers */}
          {["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"].map((day, i) => (
            <div key={i} className="bg-[#1c1e22] p-3 text-center font-medium border-b border-[#2a2d32]">{day}</div>
          ))}

          {/* Calendar cells - empty grid */}
          {Array(28).fill(null).map((_, i) => (
            <div key={i} className="bg-[#1c1e22] p-3 min-h-40 border-b border-[#2a2d32]">
              {/* Empty calendar cell */}
              <div className="text-gray-500 text-sm">{i % 7 === 0 ? `Week ${Math.floor(i / 7) + 1}` : ''}</div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Calendar;
